import logo from './logo.svg';
import './App.css';
import './index.css';
import ReactSearchBox from 'react-search-box'
import data from "./Components/ListData.json"

const List = (props) =>{
  return (
    <ul>
        {data.map((item) => (
            <li key={item.id}>{item.text}</li>
        ))}
    </ul>
  )
}


const SerachBox = (props) =>{
  return <ReactSearchBox
  placeholder="Search a course"
  value="Doe"
  data={props.list}
  callback={(record) => console.log(record)}
  />
}

data = [
  {
    key: "john",
    value: "John Doe",
  },
  {
    key: "jane",
    value: "Jane Doe",
  },
  {
    key: "mary",
    value: "Mary Phillips",
  },
  {
    key: "robert",
    value: "Robert",
  },
  {
    key: "karius",
    value: "Karius",
  },
];

function App() {

  return (
    <div className="App">
      <button className = "loginButton">Login</button>

      <p className="helloWorld">
        Hello World
        <SerachBox list="data"/>
      </p>


    </div>


  );
}

export default App;
